import {FETCH_INSTRUCTOR_REQUEST, FETCH_INSTRUCTOR_SUCCESS, FETCH_INSTRUCTOR_FAILURE} from './instructorTypes';
import axios from 'axios';

export const fetchInstructors = () => {
    return dispatch => {
        dispatch(fetchInstructorRequest());
        axios.get("https://randomapi.com/api/6de6abfedb24f889e0b5f675edc50deb?fmt=raw&sole")
            .then(response => {
                dispatch(fetchInstructorSuccess(response.data));
            })
            .catch(error => {
                dispatch(fetchInstructorFailure(error.message));
            });
    };
};

const fetchInstructorRequest = () => {
    return {
        type: FETCH_INSTRUCTOR_REQUEST
    };
};

const fetchInstructorSuccess = instructors => {
    return {
        type: FETCH_INSTRUCTOR_SUCCESS,
        payload: instructors
    };
};

const fetchInstructorFailure = error => {
    return {
        type: FETCH_INSTRUCTOR_FAILURE,
        payload: error
    };
};
